import React from 'react'
import { Route } from 'react-router-dom';
import { useParams } from 'react-router-dom'

const QuoteDetail = () => {
  const params = useParams();
  return (
    <div>
      {params.id}
      <Route path='quotes/:id/comments'></Route>
    </div>
  )
}

export default QuoteDetail
